import React from "react";
import styled from "styled-components";

const VideoContainer = styled.div`
  width: 100vw;
  height: 100vh;
  background-color: var(--color-black);
  overflow: hidden;
`;

const VideoPlayer = () => {
  return (
    <VideoContainer>
      <video src={`${process.env.PUBLIC_URL}/videos/2.mp4`} autoPlay muted />
    </VideoContainer>
  );
};

export default VideoPlayer;
